import { React, useState } from "react";
import Navs from "../Navs";

const Sabbir = () => {
  const [bal, setbal] = useState({
    name: "lemon",
    gf: "anisha vabi",
  });
  const [bal2, setbal2] = useState("udoy");
  return (
    <div>
      <h1 onClick={() => setbal("novana")}>{bal}</h1>
      <Navs var={bal} var2={bal2} />
    </div>
  );
};

export default Sabbir;
